prompt:
list all physics nobel laureates who won their prize after Niels Bohr but before Richard Feynman! This query gives Niels Bohrs date: 
SELECT ?date
WHERE {
wd:Q7085 p:P166 ?statement .
?statement ps:P166 ?award .
?award wdt:P279 wd:Q7191 .
?statement pq:P585 ?date .
}
, this query gives Richard Feynmans date: 
SELECT ?date
WHERE {
wd:Q39246 p:P166 ?statement .
?statement ps:P166 ?award .
?award wdt:P279 wd:Q7191 .
?statement pq:P585 ?date .
}
, and this query gives all physics nobel laureates from 2000 to 2010: 
SELECT DISTINCT ?laureateLabel
WHERE {
?laureate wdt:P31 wd:Q5 ;
p:P166 ?awardStatement . 
?awardStatement ps:P166 wd:Q38104 ;
pq:P585 ?awardDate .
FILTER (YEAR(?awardDate) >= 2000 && YEAR(?awardDate) <= 2010)
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
}
}
ORDER BY ?awardDate ?laureateLabel

